import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import './App.css';
import logo from './logo.png'

import Routes from './routes/Routes';

function App() {
  return (
        <div className="App">
            <img src={logo} className="App-logo" alt="logo"/>
            <AppBar position="static">
                
            </AppBar>
            <Routes/>
        </div>
  );
}

export default App;
